"},{"operationName":"PageTree","variables":{"paginationLimit":500,"contentId":"1565590307","spaceKey":"INT"},"query":"query PageTree($spaceKey: String!, $contentId: ID!, $paginationLimit: Int, $nearestAncestorCursor: String, $naPreviousSiblingsCursor: String, $naFollowingSiblingsCursor: String, $previousSiblingsCursor: String, $followingSiblingsCursor: String, $childrenCursor: String) {
  currentPage: page(id: $contentId, pageTree: $paginationLimit, enablePaging: true) {
    ...PageInfoFragment
    nearestAncestors(after: $nearestAncestorCursor) {
      count
      pageInfo {
        hasNextPage
        endCursor
        __typename
      }
      nodes {
        ...PageInfoFragment
        previousSiblings(after: $naPreviousSiblingsCursor) {
          ...PageListFragment
          __typename
        }
        followingSiblings(after: $naFollowingSiblingsCursor) {
          ...PageListFragment
          __typename
        }
        __typename
      }
      __typename
    }
    previousSiblings(after: $previousSiblingsCursor) {
      ...PageListFragment
      __typename
    }
    followingSiblings(after: $followingSiblingsCursor) {
      ...PageListFragment
      __typename
    }
    children(after: $childrenCursor) {
      ...PageListFragment
      __typename
    }
    __typename
  }
  rootLevelPages: pages(spaceKey: $spaceKey) {
    nodes {
      ...PageInfoFragment
      __typename
    }
    __typename
  }
  space(key: $spaceKey) {
    id
    homepage {
      id
      __typename
    }
    operations {
      operation
      targetType
      __typename
    }
    __typename
  }
}

fragment PageInfoFragment on Page {
  id
  title
  hasChildren
  hasRestrictions
  hasInheritedRestrictions
  links {
    webui
    __typename
  }
  __typename
}

fragment PageListFragment on PaginatedPageList {
  count
  nodes {
    ...PageInfoFragment
    __typename
  }
  pageInfo {
    hasNextPage
    endCursor
    __typename
  }
  __typename
}
